(337, 'DEBUG-1', 2, 'all elements', 0, NULL, '_CNAME_337', '_ERR_337', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_337', NULL, NULL, NULL, NULL, '', NULL, NULL, 'setErrorMsg(''[''.getAttributeValue(''id'').''] visible =>''.getAttributeValue(''visible:action'').'', left =>''.getAttributeValue(''left'').'', top =>''.getAttributeValue(''top''));\r\nassertTrue(!getAttributeValue(''visible:action''));\r\n//assertTrue(getAttributeValue(''change'')==="true");', 1, '2015-09-16 13:32:11'),
(339, 'FXR-6B', 2, 'a', 0, NULL, '_CNAME_339', '_ERR_339', '_DESC_339', NULL, NULL, NULL, '_HOWTOREPAIR_339', NULL, NULL, NULL, NULL, '_PROCEDURE_339', NULL, NULL, '$filter["parent"]=".breadcrumb li";\r\nfilterElement($filter);\r\n\r\nsetErrorMsg("a) <code>text</code> missing. Add some <code>text</code> or remove this element.");\r\nassertAttributeValue(array("text"=>"/.+/"));\r\n\r\nsetErrorMsg("b) empty <code>href</code> attribute not allowed. Fill in the <code>href</code> attribute with valid link.");\r\nassertAttributeValue(array("href"=>"/.+/"));', 1, '2015-09-27 15:20:13'),
(341, 'FXR-12A', 2, 'all elements', 0, NULL, '_CNAME_341', '_ERR_341', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_341', NULL, NULL, NULL, NULL, '_PROCEDURE_341', NULL, NULL, '$filter["parent"]=".fx-entity-header-headings";\r\n$filter["element"]=".pull-right";\r\n$filter["child"]="a,button";\r\nfilterElement($filter);\r\n\r\nassertTrue(getAttributeValue("count_childs")<=5);', 1, '2015-09-27 19:42:46'),
(342, 'FXR-12B', 2, 'all elements', 0, NULL, '_CNAME_342', '_ERR_342', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_342', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$filter["parent"]=".fx-entity-header-headings";\r\n$filter["element"]=".pull-right";\r\n$filter["child"]="a,button";\r\nfilterElement($filter);\r\n\r\n$all      = getAttributeValue("count_childs");\r\n$links    = getAttributeValue("count", array("child"=>"a, button", "strict"=>true));\r\n$subLinks = getAttributeValue("count", array("child"=>".btn-group a,.btn-group button"));\r\n$dropdown = getAttributeValue("count", array("child"=>".btn-group [data-toggle=''dropdown'']"));\r\n\r\n$last     = getAttributeValue("tag", array("pos"=>"last", "child"=>"*"));\r\n\r\n$R1       = ($subLinks>0 && $all==$links+1 && $last!=="a" && $last!=="button" && $dropdown>0);\r\n$R2       = ($subLinks==0 && $all==$links && $dropdown==0);\r\n\r\nassertTrue($R1 || $R2);', 1, '2015-09-27 20:55:09'),
(340, 'FXR-11B', 2, 'td', 0, NULL, '_CNAME_340', '_ERR_340', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_340', NULL, NULL, NULL, NULL, '_PROCEDURE_340', NULL, NULL, '$filter["element"]=".fx-table-actions";\r\nfilterElement($filter);\r\n\r\n$all      = getAttributeValue("count_childs");\r\n$links    = getAttributeValue("count", array("child"=>"a, button", "strict"=>true));\r\n$subLinks = getAttributeValue("count", array("child"=>".btn-group a,.btn-group button"));\r\n$dropdown = getAttributeValue("count", array("child"=>".btn-group [data-toggle=''dropdown'']"));\r\n\r\n$last     = getAttributeValue("tag", array("pos"=>"last", "child"=>"*"));\r\n\r\n$R1       = ($subLinks>0 && $all==$links+1 && $last!=="a" && $last!=="button" && $dropdown>0);\r\n$R2       = ($subLinks==0 && $all==$links && $dropdown==0);\r\n\r\nassertTrue($R1 || $R2);', 1, '2015-09-27 18:51:51'),
(343, 'FXR-8A', 2, 'all elements', 0, NULL, '_CNAME_343', '_ERR_343', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_343', NULL, NULL, NULL, NULL, '_PROCEDURE_343', NULL, NULL, '$filter["parent"]=".fx-bulk-actions, .fx-sidebar-tree-bulk-actions, .fx-entity-header-headings";\r\n$filter["element"]=".pull-left";\r\nfilterElement($filter);\r\n\r\nassertTrue(getAttributeValue("id",array("child"=>".glyphicon-plus, .fuxicons-add-in-table"))==false);', 1, '2015-09-27 21:11:40'),
(344, 'FXR-7', 2, 'all elements', 0, NULL, '_CNAME_344', '_ERR_344', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_344', NULL, NULL, NULL, NULL, '_PROCEDURE_344', NULL, NULL, '$filter["parent"]=".fx-form-content";\r\n$filter["element"]=".fx-form-block";\r\nfilterElement($filter);\r\n\r\n$firstBlockID=getAttributeValue("id", array("parent"=>true,"child"=>".fx-form-block"));\r\nskipCheck(getAttributeValue("id")!=$firstBlockID);\r\n\r\nsetErrorMsg("a) No <code>.fx-first</code> class found. Add <code>.fx-first</code> class into the first child.");\r\nassertTrue(getAttributeValue("count", array("child"=>".fx-first"))>0);\r\n\r\n$allRequiredInfo = getAttributeValue("count", array("parent"=>true, "child"=>".fx-required-fields-message"));\r\nsetErrorMsg("b) ".$allRequiredInfo." required field info found and only one or none is allowed. Remove some required field info.");\r\nassertTrue($allRequiredInfo<=1);\r\n\r\n$requiredFields = getAttributeValue("count", array("parent"=>true, "child"=>".fx-required-field"));\r\n$requiredInfo = getAttributeValue("count", array("child"=>".fx-first .fx-required-fields-message"));\r\n\r\n$R1 = $requiredFields==0 && $requiredInfo==0;\r\n$R2 = $requiredFields>0 && $requiredInfo==1;\r\n\r\nsetErrorMsg("c) Required field info exists without required fields. Remove required field info or add required fields.");\r\nassertTrue($requiredFields>0 && $allRequiredInfo==1 || $allRequiredInfo==0);\r\n\r\nsetErrorMsg("d) Wrong required field info position. Move it into </code>.fx-first</code> element.");\r\nassertTrue(($requiredInfo>0 && $allRequiredInfo>0) || $requiredInfo>0);\r\n\r\nsetErrorMsg("e) Required field info missing. Create it into <code>.fx-first</code> element.");\r\nassertTrue($R1 || $R2);', 1, '2015-09-28 14:11:14'),
(345, 'FXR-13', 2, 'all elements', 0, NULL, '_CNAME_345', '_ERR_345', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_345', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$filter["parent"]=".ui-sortable , .ui-draggable";\r\n$filter["element"]=".fx-sortable, .fx-draggable";\r\nfilterElement($filter);\r\n\r\nassertTrue(getAttributeValue("user")==''dragged'');', 0, '2015-09-28 20:39:02'),
(348, 'FXR-9D', 2, 'all elements', 0, NULL, '_CNAME_348', '_ERR_348', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_348', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$filter["parent"]=".fx-sidebar, .fx-entity-header-headings";\r\n$filter[''element'']=''.btn'';\r\nfilterElement($filter);\r\n\r\nsetErrorMsg("a) <code>.btn-sm</code> class not found in this element, add .btn-sm.");\r\nassertAttributeValue(array("class"=>"/btn-sm/"));\r\n\r\n$height=getAttributeValue("height");\r\nskipCheck($height===false);\r\n\r\nsetErrorMsg("b) <code>.btn-xs</code> exists but the button don''t have the correct size. Remove any overriding style.");\r\nassertTrue(getAttributeValue("outer-height")-$height==12 && $height==18);', 1, '2015-10-27 04:04:34'),
(346, 'FXR-8B', 2, 'all elements', 0, NULL, '_CNAME_346', '_ERR_346', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_346', '', NULL, NULL, NULL, '_PROCEDURE_346', NULL, NULL, '$filter["element"]=".btn";\r\n$filter["child"]=".glyphicon-plus, .fuxicons-add-in-table";\r\nfilterElement($filter);\r\n\r\n$btnPos=getAttributeValue("left:relative");\r\nskipCheck($btnPos);\r\n\r\n$child["parent"]=true;\r\n$child["child"]="*";\r\n$child["pos"]="first";\r\nassertTrue($btnPos==getAttributeValue("left:relative", $child));', 1, '2015-10-26 23:53:57'),
(349, 'FXR-4B', 2, 'all elements', 0, NULL, '_CNAME_349', '_ERR_349', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_349', NULL, '_QUESTION_349', '_DECISIONPASS_349', '_DECISIONFAIL_349', NULL, NULL, NULL, '$filter["element"] = ".fx-info-icon";\r\nfilterElement($filter);\r\n\r\nskipCheck(getAttributeValue("text",array("parent"=>true))!="");\r\n\r\nsetErrorMsg("a) <code>title</code> attribute is missing. Create and fill in the <code>title</code> attribute.");\r\nassertTrue(getAttributeValue("title")!==false);\r\n\r\nsetErrorMsg("b) fill in the <code>title</code> attribute.");\r\nassertAttributeValue(array("title"=>"/.+/"));', 1, '2015-10-28 14:26:37'),
(347, 'FXR-9C', 2, 'all elements', 0, NULL, '_CNAME_347', '_ERR_347', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_347', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$filter[''parent'']=''.fx-bulk-actions'';\r\n$filter[''element'']=''.btn'';\r\nfilterElement($filter);\r\n\r\nskipCheck(getAttributeValue("id",array("parent"=>".fx-dropdown"))!=false);\r\n\r\nsetErrorMsg("a) <code>.btn-xs</code> class not found in this element, add <code>.btn-xs</code>.");\r\nassertAttributeValue(array("class"=>"/btn-xs/"));\r\n\r\n$height=getAttributeValue("height");\r\nskipCheck(getAttributeValue("visible")===false);\r\n\r\nsetErrorMsg("b) <code>.btn-xs</code> exists but the button don''t have the correct size. Remove any overriding style.");\r\nassertTrue(getAttributeValue("outer-height")-$height==4 && $height==18);', 1, '2015-10-27 02:45:15'),
(350, 'FXR-4C', 2, 'li', 0, NULL, '_CNAME_350', '_ERR_350', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_350', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$filter["parent"] = ".fx-page-main-menu";\r\nfilterElement($filter);\r\n\r\nsetErrorMsg("a) <code>data-original-title</code> attribute is missing. Create and fill in the <code>data-ofiginal-title</code> attribute.");\r\nassertTrue(getAttributeValue("data-original-title")!==false);\r\n\r\nsetErrorMsg("b) fill in the <code>data-original-title</code> attribute.");\r\nassertAttributeValue(array("data-original-title"=>"/.+/"));', 1, '2015-10-28 15:16:11'),
(351, 'FXR-4D', 2, 'a', 0, NULL, '_CNAME_351', '_ERR_351', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_351', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$filter["parent"] = ".fx-nav";\r\nfilterElement($filter);\r\n\r\n$text=getAttributeValue("text");\r\n$spanText=getAttributeValue("text",array("child"=>"span","pos"=>"first"));\r\n$spanVisible=getAttributeValue("visible",array("child"=>"span","pos"=>"first"));\r\n\r\nskipCheck($text!="" || ($spanText!="" && $spanVisible));\r\n\r\nsetErrorMsg("a) <code>data-original-title</code> or <code>title</code> attribute is missing.");\r\nassertTrue(getAttributeValue("data-original-title")!==false || getAttributeValue("title")!==false);\r\n\r\nsetErrorMsg("b) fill in the <code>data-original-title</code> or <code>title</code> attribute.");\r\nassertTrue(getAttributeValue("data-original-title")!="" || getAttributeValue("title")!="");', 1, '2015-10-28 15:47:54'),
(352, 'FXR-5B', 2, 'all elements', 0, NULL, '_CNAME_352', '_ERR_352', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_352', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$filter["element"]=".fx-info-icon";\r\nfilterElement($filter);\r\n\r\nskipCheck(getAttributeValue("visible")==false);\r\n$br=getAttributeValue("border-radius");\r\n\r\nsetErrorMsg("a) Background shape isn''t square.");\r\nassertTrue(getAttributeValue("height")==getAttributeValue("width"));\r\n\r\nsetErrorMsg("b) No <code>border-radius</code> found, add it with <code>3px</code>.");\r\nassertTrue($br!==false);\r\n\r\nsetErrorMsg("c) <code>border-radius</code> found is <code>".$br."px</code> and it should be <code>3px</code>.");\r\nassertTrue($br==3);', 1, '2015-10-28 18:13:54'),
(353, 'FXR-9B2', 2, 'all elements', 0, NULL, '_CNAME_353', '_ERR_353', NULL, NULL, NULL, NULL, '_HOWTOREPAIR_353', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$filter["element"]=".btn";\r\nfilterElement($filter);\r\n\r\nskipCheck(getAttributeValue("text")=="" || getAttributeValue("visible")===false);\r\n\r\n$fs=getAttributeValue("font-size");\r\nsetErrorMsg(''a) <code>font-size</code> found is <code>''.$fs.''px</code> and it should be <code>12px</code> or <code>13px</code>.'');\r\nassertTrue($fs==12 || $fs==13);', 1, '2015-10-30 01:02:08');
INSERT INTO `AC_check_examples` (`check_example_id`, `check_id`, `type`, `description`, `content`, `expected_attribute`, `expected_value`) VALUES
(1, 1, '1', '<code>img</code> element with an <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>Testfile - Check #1 - Negative</title>\r\n</head>\r\n<body>\r\n<p><img src="rex.jpg" alt="A black and brown cat named Rex." /></p>\r\n</body>\r\n</html>', NULL, NULL),
(2, 1, '0', '<code>img</code> element without an <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>Testfile - Check #1 - Positive</title>\n</head>\n<body>\n<p><img src="rex.jpg"/></p>\n</body>\n</html>', NULL, NULL),
(3, 2, '1', 'Alt text is different from <code>src</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #2 - Negative</title>\r</head>\r<body>\r<img src="rex.jpg" alt="photo of rex the cat"/>\r</body>\r</html>', NULL, NULL),
(4, 2, '0', 'Alt text is the same as <code>src</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #2 - Positive</title>\r</head>\r<body>\r<img src="rex.jpg" alt="rex.jpg"/>\r</body>\r</html>', NULL, NULL),
(1098, 3, '1', 'Alt text is shorter than 100 characters.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #3 - Negative</title>\r\n</head>\r\n<body>\r\n<p><img src="rex.jpg" alt="Photo of Rex the cat playing with butterflys in the wood."/></p>\r\n</body>\r\n</html>', NULL, NULL),
(1099, 3, '0', 'Alt text is longer than 100 characters.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #3 - Positive</title>\r\n</head>\r\n<body>\r\n<p><img src="rex.jpg" alt="A picture of Rex the cat with some extra text. This is very long alt text. In fact, it was much much too long for this image. Sort alt text would be much better and this alt text should be shortened."/></p>\r\n</body>\r\n</html>', NULL, NULL),
(1105, 4, '0', 'IMG is non-decorative but has empty Alt text.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\r\n<html lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #4 - Positive</title>\r\n</head>\r\n<body>\r\n<p>We would like to adopt another pet and are looking for one that is similar to what''s shown in the picture.</p>\r\n<img src="rex.jpg" alt="" width="150" height="105"/>\r\n</body>\r\n</html>', NULL, NULL),
(1107, 5, '0', '<code>img</code> element has whitespace Alt text and width and height are both greater than 5.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #5 - Positive</title>\r\n</head>\r\n<body>\r\n<img src="line.jpg" alt="Decorative" width="50" height="1"/>\r\n</body>\r\n</html>', NULL, NULL),
(11, 6, '1', '<code>img</code> has alt text that does not contain any placeholder text.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>OAC Testfile - Check #6 - Negative</title>\n</head>\n<body>\n<p><img src="rex.jpg" alt="Photo of a brown and black cat named Rex."/></p>\n</body>\n</html>', NULL, NULL),
(12, 6, '0', '<code>img</code> has alt text of ''spacer''.', '<?xml version="1.0" encoding="UTF-8"?>\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\n<head>\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\n<title>OAC Testfile - Check #6 - Positive</title>\n</head>\n<body>\n<p><img src="rex.jpg" alt="spacer" width="150" height="105"/></p>\n</body>\n</html>', NULL, NULL),
(13, 7, '1', '<code>img</code> is contained by A element, anchor has no other text and Alt text is not empty.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #7 - Negative</title>\r</head>\r<body>\r<p><a href="rex.html"><img src="rex.jpg" alt="a story about Rex the cat"/></a></p>\r</body>\r</html>', NULL, NULL),
(14, 7, '0', '<code>img</code> is contained by A element, anchor has no other text and Alt text is empty.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #7 - Positive</title>\r</head>\r<body>\r<p><a href="rex.html"><img src="rex.jpg" alt=""/></a></p>\r</body>\r</html>', NULL, NULL),
(1096, 8, '1', 'Image is not fully described in Alt text but image has a <code>longdesc</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #8.2 - Negative</title>\r\n</head>\r\n<body>\r\n<p>The text in this document does not fully describe the image shown here but the image contains a longdesc attribute linking to a text file that does describe the image. <img src="chart.gif" alt="a complex chart" longdesc="chart.html" height="120"/></p>\r\n</body>\r\n</html>', NULL, NULL),
(1097, 8, '0', 'Image is not fully described in Alt text and a long description is not provided.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #8.1 - Positive</title>\r\n</head>\r\n<body>\r\n<p>The text in this document does not fully describe the complex image shown here.\r\n<img src="chart.gif" alt="a complex chart" height="120"/></p>\r\n</body>\r\n</html>', NULL, NULL),
(17, 9, '1', '<code>img</code> with a <code>longdesc</code> and d-link.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #9 - Positive</title>\r\n</head>\r\n<body>\r\n<p><img src="rex.jpg" alt="photo of Rex the cat" width="300" height="300" longdesc="rex.html" />\r\n<a href="rex.html">[d]</a></p>\r\n</body>\r\n</html>', NULL, NULL),
(18, 9, '0', '<code>img</code> with <code>longdesc</code> but no d-link.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #9 - Positive</title>\r\n</head>\r\n<body>\r\n<p><img src="rex.jpg" alt="photo of Rex the cat" width="300" height="300" longdesc="rex.html" /></p>\r\n</body>\r\n</html>', NULL, NULL),
(19, 10, '1', 'Image does not flicker.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\r<html lang="en">\r<head>\r<title>ATRC Testfile - Check #10.2 - Negative</title>\r</head>\r<body>\r<img src="rex.gif" alt="A brown and black cat named Rex."/>\r</body>\r</html>', NULL, NULL),
