(107, 54, '1', '<code>title</code> describes the document', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>The History Of Birds</title>\r</head>\r<body>\r<h1>History Of Birds</h1>\r<p>This document contains the history of Birds.\rThe title of the document is appropriate.</p>\r</body>\r</html>', 'html_code', '<title>The History Of Birds</title>'),
(108, 54, '0', '<code>title</code> does not describe the document', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>New Page</title>\r</head>\r<body>\r<h1>History Of Birds</h1>\r<p>This document contains a history of birds.\rThe title of this document does not describe the contents of this document.</p>\r</body>\r</html>', NULL, NULL),
(109, 55, '1', 'Does not have an <code>input</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #55 - Negative</title>\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(110, 55, '0', 'Has <code>input</code> element', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #55 - Positive</title>\r</head>\r<body>\r<form>\r<label for="name">Name:</label> <input type="text" name="name" id="name"></form>\r</body>\r</html>', NULL, NULL),
(111, 57, '1', '<code>input</code> has associated label with matching <code>for</code> and <code>id</code>attributes.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #57 - Negative</title>\r</head>\r<body>\r<form action="http://somesite.com/prog/adduser" method="post">\r<p>\r<label for="firstname">First name:</label> \r<input type="text" name="firstname" id="firstname" tabindex="1" />\r</p>\r</form>\r</body>\r</html>', NULL, NULL),
(112, 57, '0', '<code>input</code> does not have associated label.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #57 - Positive</title>\r</head>\r<body>\r<form action="http://somesite.com/prog/adduser" method="post">\r<p>\r<label>First name:</label> \r<input type="text" name="firstname" tabindex="1" />\r</p>\r</form>\r</body>\r</html>', NULL, NULL);
INSERT INTO `AC_check_examples` (`check_example_id`, `check_id`, `type`, `description`, `content`, `expected_attribute`, `expected_value`) VALUES
(113, 58, '1', '<code>input</code> element, <code>type</code> of "image", has <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #58 - Negative</title>\r</head>\r<body>\r<form action="http://example.com/prog/text-read" method="post">\r<p><input type="image" name="submit" src="finddogs.gif" alt="Find Dogs" /></p>\r</form>\r</body>\r</html>', NULL, NULL),
(114, 58, '0', '<code>input</code> element, <code>type</code> of "image", is missing <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #58 - Positive</title>\r</head>\r<body>\r<form action="http://example.com/prog/text-read" method="post">\r<p><input type="image" name="submit" src="finddogs.gif" /></p>\r</form>\r</body>\r</html>', NULL, NULL),
(115, 59, '1', '<code>input</code> element, <code>type</code> of "image", has Alt text that identifies the purpose or function of the image.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>ATRC Testfile - Check #59 - Negative</title>\r</head>\r<body>\r<form action="http://example.com" method="post">\r<p><input type="image" name="submit" src="rex.jpg" alt="search for cats" /></p>\r</form>\r</body>\r</html>', 'html_code', '<input type="image" name="submit" src="rex.jpg" alt="search for cats" />'),
(116, 59, '0', '<code>input</code> element, <code>type</code> of "image", has Alt text that does not identify the purpose or function of the image.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>ATRC Testfile - Check #59 - Positive</title>\r</head>\r<body>\r<form action="http://example.com" method="post">\r<p><input type="image" name="submit" src="rex.jpg" alt="A brown and black cat named Rex." /></p>\r</form>\r</body>\r</html>', NULL, NULL),
(117, 60, '1', '<code>input</code> element, <code>type</code> of "image", has Alt text less than 100 characters.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #60 - Negative</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="input.jpg" alt="name">\r</form>\r</body>\r</html>', NULL, NULL),
(118, 60, '0', '<code>input</code> element, <code>type</code> of "image", has Alt text greater than 100 characters.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #60 - Positive</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="name.jpg" alt="This is some very long alt text for the contro''s image. Your alt text should not be this long. Shorten the text to make it more accessible and more pleasant for all.">\r</form>\r</body>\r</html>', NULL, NULL),
(119, 61, '1', '<code>input</code> <code>alt</code> attribute is different from the <code>src</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #61 - Negative</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="input.jpg" alt="input name">\r</form>\r</body>\r</html>', NULL, NULL),
(120, 61, '0', '<code>input</code> <code>alt</code> attribute is same as the <code>src</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #61 - Positive</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="name.jpg" alt="name.jpg">\r</form>\r</body>\r</html>', NULL, NULL),
(121, 62, '1', '<code>input</code> <code>alt</code> attribute is valid text.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #62 - Negative</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="input.jpg" alt="input name">\r</form>\r</body>\r</html>', NULL, NULL),
(122, 62, '0', '<code>input</code> <code>alt</code> attribute is "image".', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #62 - Positive</title>\r</head>\r<body>\r<form>\r<label for="name">Name</label>: <br/><br/><input type="image" name="name" id="name" src="name.jpg" alt="image">\r</form>\r</body>\r</html>', NULL, NULL),
(123, 63, '1', '<code>input</code> element, <code>type</code> of text, contains default text.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #63 - Positive</title>\r</head>\r<body>\r<form action="http://somesite.com/prog/adduser" method="post">\r<label for="name">Name</label>: <input type="text" name="name" id="name" value="your name here">\r<input type="submit" value="Send"></form>\r</form>\r</body>\r</html>', NULL, NULL),
(124, 63, '0', '<code>input</code> element, <code>type</code> of text, missing default text.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #63 - Positive</title>\r</head>\r<body>\r<form action="http://somesite.com/prog/adduser" method="post">\r<label for="name">Name</label>: <input type="text" name="name" id="name">\r<input type="submit" value="Send"></form>\r</form>\r</body>\r</html>', NULL, NULL),
(125, 64, '1', '<code>area</code> element has <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #64 - Negative</title>\r</head>\r<body>\r<p><map id="map1" name="map1">\r<area shape="rect" coords="0,0,30,30" href="reference.html" alt="reference section"/>\r</map></p>\r</body>\r</html>', NULL, NULL),
(126, 64, '0', '<code>area</code> element missing <code>alt</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #64 - Positive</title>\r</head>\r<body>\r<p><map id="map1" name="map1">\r<area shape="rect" coords="0,0,30,30" href="reference.html" />\r</map></p>\r</body>\r</html>', NULL, NULL),
(127, 65, '1', 'Alt text identifies the link destination.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #65 - Negative</title>\r</head>\r<body>\r<p><img src="library.gif" usemap="#map1" alt="Image map of areas in the library" /> </p>\r<p><map id="map1" name="map1">\r<area shape="rect" coords="0,0,50,50" href="reference.html" alt="reference section"/>\r</map></p>\r</body>\r</html>', 'html_code', '<area shape="rect" coords="0,0,50,50" href="reference.html" alt="reference section"/>'),
(128, 65, '0', 'Alt text does not identify the link destination.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #65 - Positive</title>\r</head>\r<body>\r<p><img src="library.gif" usemap="#map1" alt="Image map of areas in the library" /> </p>\r<p><map id="map1" name="map1">\r<area shape="rect" coords="0,0,50,50" href="reference.html" alt="drawing of a blue book"/>\r</map></p>\r</body>\r</html>', NULL, NULL),
(129, 66, '1', '<code>area</code> has link to sound file (.mp3) and has a text equivalent link.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #66 - Negative</title>\r</head>\r<body>\r<p><img src="welcome.gif" usemap="#map1"  alt="Image map of areas in the library" /></p>\r<p><map id="map1" name="map1">\r<area shape="rect" coords="0,0,80,30" href="reference.html" alt="Reference" />\r<area shape="rect" coords="0,35,110,100" href="avlab.mp3" alt="Audio Visual Lab" />\r</map></p>\r<p><a href="avlab.txt">Audio Visual Lab Text Transcript</a></p>\r</body>\r</html>', 'html_code', '<area shape="rect" coords="0,35,110,100" href="avlab.mp3" alt="Audio Visual Lab" />'),
(130, 66, '0', '<code>area</code> has link to sound file (.mp3) but no text equivalent link.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #66 - Positive</title>\r</head>\r<body>\r<p><img src="welcome.gif" usemap="#map1"  alt="Image map of areas in the library" /></p>\r<p><map id="map1" name="map1">\r<area shape="rect" coords="0,0,80,30" href="reference.html" alt="Reference" />\r<area shape="rect" coords="0,35,110,100" href="avlab.mp3" alt="Audio Visual Lab" />\r</map></p>\r</body>\r</html>', NULL, NULL),
(131, 68, '1', '<code>area</code> has target of "_self".', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #68 - Negative</title>\r</head>\r<body>\r<map id="map1" name="map1">\r  <area shape="rect" coords="0,0,30,30" href="reference.html" alt="reference section" target="_self"/>\r</map></body>\r</html>', NULL, NULL),
(132, 68, '0', '<code>area</code> has target of new window.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #68 - Positive</title>\r</head>\r<body>\r<map id="map1" name="map1">\r  <area shape="rect" coords="0,0,30,30" href="reference.html" alt="hello" target="new window"/>\r</map></body>\r</html>', NULL, NULL),
(133, 69, '1', 'Does not contain <code>marquee</code> element.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #69 - Negative</title>\r</head>\r<body>\r<p>There is no marquee text in this document.</p>\r</body>\r</html>', NULL, NULL),
(134, 69, '0', 'Contains <code>marquee</code> element.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #69 - Positive</title>\r</head>\r<body>\r<p><marquee>this is marquee text</marquee></p>\r</body>\r</html>', NULL, NULL),
(135, 71, '1', 'Does not contain auto-redirect.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #71 - Negative</title>\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(136, 71, '0', 'Contains auto-redirect.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #71 - Positive</title>\r<meta  http-equiv="refresh" content="http://www.foo.com/bar.html" />\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(137, 72, '1', 'meta refresh used with a timeout of zero', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>ATRC Testfile - Check #72.2 - Negative</title>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<meta  http-equiv="refresh" content="0; url=http://test.com" />\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(138, 72, '0', 'meta refresh used with a timeout', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>ATRC Testfile - Check #72.1 - Positive</title>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<meta  http-equiv="refresh" content="30; url=http://test.com" />\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(139, 73, '1', '<code>object</code> element not used', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #74 - Negative</title>\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(140, 73, '0', '<code>object</code> element used.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #73 - Positive</title>\r</head>\r<body>\r<object/>\r</body>\r</html>', NULL, NULL),
(141, 74, '1', '<code>object</code> element not used', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #74 - Negative</title>\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
