(144, 75, '0', '<code>object</code> element used.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #75 - Positive</title>\r</head>\r<body>\r<object codebase="hello"/>\r</body>\r</html>', NULL, NULL),
(145, 76, '1', '<code>object</code> element not used', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #76 - Negative</title>\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(146, 76, '0', '<code>object</code> element used.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #76 - Positive</title>\r</head>\r<body>\r<object codebase="hello"/>\r</body>\r</html>', NULL, NULL),
(147, 77, '1', '<code>object</code> element not used.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #77 - Negative</title>\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
