(169, 91, '1', '<code>select</code> element has an associated label using <code>label</code> element.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile 91.2 - Negative</title>\r</head>\r<body>\r<form method="post" action="http://www.test.com">\r<p>\r<label for="animal">Animal:</label>\r<select name="abcselect" id="animal">\r<option value="1">dog</option>\r<option value="2">cat</option>\r<option value="3">bird</option>\r</select>\r</p>\r</form>\r</body>\r</html>', NULL, NULL),
