(980, 135, '1', 'Image contains math and document has MathML.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.1 plus MathML 2.0//EN" "http://www.w3.org/TR/MathML2/dtd/xhtml-math11-f.dtd" [\r\n  <!ENTITY mathml "http://www.w3.org/1998/Math/MathML"> ]>\r\n<html lang="en">\r\n	<head>\r\n		<title>Testfile - Check #135 - Negative</title>\r\n	</head>\r\n	<body>\r\n		<p>The following image shows the solution to the quadratic equation: begin fraction minus b plus or \r\n			minus begin square root of b squared minus four a c end square root over 2 a \r\n			end fraction</p>\r\n		<img src="http://lists.w3.org/Archives/Public/w3c-wai-gl/2004OctDec/att-0487/quadeqn.png" alt="solution to the quadratic equation" width="179" height="63">\r\n		<math xmlns=''http://www.w3.org/1998/Math/MathML''>\r\n			<mfrac>\r\n				<mrow>\r\n					<mrow>\r\n						<mo>-</mo>\r\n						<mi>b</mi>\r\n					</mrow>\r\n					<mo>&pm;</mo>\r\n					<msqrt>\r\n						<mrow>\r\n							<msup>\r\n								<mi>b</mi>\r\n								<mn>2</mn>\r\n							</msup>\r\n							<mo>-</mo>\r\n							<mrow>\r\n								<mn>4</mn>\r\n								<mo>&it;</mo>\r\n								<mi>a</mi>\r\n								<mo>&it;</mo>\r\n								<mi>c</mi>\r\n							</mrow>\r\n						</mrow>\r\n					</msqrt>\r\n				</mrow>\r\n				<mrow>\r\n					<mn>2</mn>\r\n					<mo>&it;</mo>\r\n					<mi>a</mi>\r\n				</mrow>\r\n			</mfrac>\r\n		</math>\r\n	</body>\r\n</html>', 'image_alt', 'solution to the quadratic equation'),
(981, 135, '0', 'Image contains math but document has no MathML.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/REC-html40/strict.dtd">\r\n<html lang="en">\r\n	<head>\r\n		<title>Testfile - Check #135 - Positive</title>\r\n	</head>\r\n	<body>\r\n		<p>The following image shows the solution to the quadratic equation: begin fraction minus b plus or minus begin square root of b squared minus four a c end square root over 2 a end fraction</p>\r\n\r\n		<img src="http://lists.w3.org/Archives/Public/w3c-wai-gl/2004OctDec/att-0487/quadeqn.png" alt="solution to the quadratic equation" width="179" height="63">\r\n	</body>\r\n</html>', NULL, NULL),
(253, 136, '1', 'Data <code>table</code> with <code>th</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #136-2 - Negative</title>\r</head>\r<body>\r\r<table border="1">\r<tr><th>name</th><th>number of cups</th><th>type</th><th>with sugar</th></tr>\r<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\r<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\r<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\r<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\r<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\r</table>\r\r</body>\r</html>', NULL, NULL),
(254, 136, '0', 'Data <code>table</code> without <code>th</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #136-1 - Positive</title>\r</head>\r<body>\r\r<table border="1">\r<tr><td>name</td><td>number of cups</td><td>type</td><td>with sugar</td></tr>\r<tr><td>Adams, Willie</td><td>2</td><td>regular</td><td>sugar</td></tr>\r<tr><td>Bacon, Lise</td><td>4</td><td>regular</td><td>no sugar</td></tr>\r<tr><td>Chaput, Maria</td><td>1</td><td>decaf</td><td>sugar</td></tr>\r<tr><td>Di Nino, Consiglio</td><td>0</td><td>not applicable</td><td>not applicable</td></tr>\r<tr><td>Eggleton, Art</td><td>6</td><td>regular</td><td>no sugar</td></tr>\r</table>\r\r</body>\r</html>', NULL, NULL),
(255, 137, '1', 'Layout <code>table</code> without <code>th</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #114-1 - Positive</title>\r</head>\r<body>\r\r<table border="0" cellpadding="5" summary="this table is used to create 2 columns of text">\r<tr><td>Latin is a dead language.</td><td>The English language thrives.</td></tr>\r<tr>\r<td>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</td>\r<td>But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure.</td>\r</tr>\r</table>\r\r</body>\r</html>', NULL, NULL),
(256, 137, '0', 'Layout <code>table</code> with <code>th</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #114-1 - Positive</title>\r</head>\r<body>\r\r<table border="0" cellpadding="5" summary="this table is used to create 2 columns of text">\r<caption>a</caption>\r<tr><th>Latin is a dead language.</th><th>The English language thrives.</th></tr>\r<tr>\r<td>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</td>\r<td>But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure.</td>\r</tr>\r</table>\r\r</body>\r</html>', NULL, NULL),
(983, 138, '0', 'Text <code>input</code> element does not have <code>tabindex</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>ATRC Testfile - Check #138.1 - Positive</title>\r\n</head>\r\n<body>\r\n<form action="http://www.example.com" method="post">\r\n<p>\r\n<label for="name">Name</label>: <input type="text" name="name" id="name" value="your name here" />\r\n</p>\r\n</form>\r\n</body>\r\n</html>', NULL, NULL),
