(1020, 84, '1', 'ASCII art has a skipover link', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #82 - Negative</title>\r\n</head>\r\n<body>\r\n\r\n<a href="#post-art">skip over ASCII art picture</a> of a bearded person wearing a hat.\r\n\r\n<PRE>\r\n          MMMMMMMM\r\n      WWWWW      WWWWW\r\n     ******************\r\n        | \\O/ \\O/ |\r\n        |    |    |\r\n        \\         /\r\n         \\  ---  /\r\n           VVVVV\r\n            VVV\r\n\r\n</PRE>\r\n\r\n<a name="post-art">First text of following main body...</a>\r\n\r\n</body>\r\n</html>', 'result', 'fail'),
