(281, 153, '0', 'Header abbreviations are long.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #153 - Positive</title>\r</head>\r<body>\r\r<TABLE border="1" summary="This simple data table demonstrates the use of summary">\r<caption>A Test Table</caption>\r<TR>\r<TD></TD>\r<TH abbr="This abbreviation is much too long.">Col. 1 header really long text</TH>\r<TH abbr="abbrev OK">Col. 2 header really long text</TH>\r</TR>\r<TR>\r<TH>Row 1 header</TH>\r<TD>C1R1</TD>\r<TD>C1R2</TD>\r</TR>\r<TR>\r<TH>Row 2 header</TH>\r<TD>C2R1</TD>\r<TD>C2R2</TD>\r</TR>\r</TABLE>\r\r\r</body>\r</html>', NULL, NULL),
