INSERT INTO `AC_check_examples` (`check_example_id`, `check_id`, `type`, `description`, `content`, `expected_attribute`, `expected_value`) VALUES
(292, 165, '1', '<code>embed</code> with <code>alt</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #165 - Negative</title>\r</head>\r<body>\r<embed alt="description of the embed" src="demo.mov">\r<noembed>Alternate content for the embed</noembed>\r</embed>\r</body>\r</html>', NULL, NULL),
(293, 165, '0', '<code>embed</code> missing <code>alt</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #165 - Positive</title>\r</head>\r<body>\r<embed src="demo.mov">\r<noembed>Alternate content for the embed</noembed>\r</embed>\r</body>\r</html>', NULL, NULL),
(294, 166, '1', '<code>embed</code> with valid <code>alt</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #166 - Negative</title>\r</head>\r<body>\r<embed alt="description of the embed" src="demo.mov">\r<noembed>Alternate content for the embed</noembed>\r</embed>\r</body>\r</html>', NULL, NULL),
(295, 166, '0', '<code>embed</code> with empty <code>alt</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #166 - Positive</title>\r</head>\r<body>\r<embed alt=""  src="demo.mov">\r<noembed>Alternate content for the embed</noembed>\r</embed>\r</body>\r</html>', NULL, NULL),
(296, 167, '1', '<code>iframe</code> without a <code>longdesc</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #167 - Negative</title>\r</head>\r<body>\r<iframe/>\r</body>\r</html>', NULL, NULL),
(297, 167, '0', '<code>iframe</code> with a <code>longdesc</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #167 - Positive</title>\r</head>\r<body>\r<iframe longdesc="file.html"/>\r</body>\r</html>', NULL, NULL),
(298, 168, '1', 'radio button group contains both <code>fieldset</code> and <code>legend</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #168 - Negative</title>\r</head>\r<body>\r\r<form action="http://example.com/donut" method="post">\r<fieldset>\r<legend>Donut Type</legend>\r<p>\r<input type="radio" name="flavour" id="choc" value="chocolate" checked="checked" />\r<label for="choc">Chocolate</label><br/>\r<input type="radio" name="flavour" id="cream" value="cream"/>\r<label for="cream">Cream Filled</label><br/>\r<input type="radio" name="flavour" id="honey" value="honey"/>\r<label for="honey">Honey Glazed</label>\r</p>\r</fieldset>\r<p><input type="submit" value="Purchase Donut"/></p>\r</form>\r\r</body>\r</html>', NULL, NULL),
(299, 168, '0', 'radio button group contains no <code>fieldset</code> or <code>legend</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #168 - Positive</title>\r</head>\r<body>\r\r<form action="http://example.com/donut" method="post">\r<p>\r<input type="radio" name="flavour" id="choc" value="chocolate" checked="checked" />\r<label for="choc">Chocolate</label><br/>\r<input type="radio" name="flavour" id="cream" value="cream"/>\r<label for="cream">Cream Filled</label><br/>\r<input type="radio" name="flavour" id="honey" value="honey"/>\r<label for="honey">Honey Glazed</label>\r<br/><input type="submit" value="Purchase Donut"/>\r</p>\r</form>\r\r</body>\r</html>', NULL, NULL),
(1041, 169, '1', '<code>option</code>s with <code>optgroup</code>.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #169 - Negative</title>\r\n</head>\r\n<body>\r\n\r\n<form action="http://example.com/prog/someprog" method="post">\r\n  <label for="ComOS">PortMaster 3</label>\r\n  <select name="ComOS" id="ComOS">\r\n    <optgroup label="PortMaster 3">\r\n      <option label="3.7.1" value="pm3_3.7.1">\r\n        PortMaster 3 with ComOS 3.7.1\r\n      </option>\r\n      <option label="3.7" value="pm3_3.7">\r\n        PortMaster 3 with ComOS 3.7\r\n      </option>\r\n      <option label="3.5" value="pm3_3.5">\r\n        PortMaster 3 with ComOS 3.5\r\n      </option>\r\n    </optgroup>\r\n    <optgroup label="PortMaster 2">\r\n      <option label="3.7" value="pm2_3.7">\r\n        PortMaster 2 with ComOS 3.7\r\n      </option>\r\n      <option label="3.5" value="pm2_3.5">\r\n        PortMaster 2 with ComOS 3.5\r\n      </option>\r\n    </optgroup>\r\n    <optgroup label="IRX">\r\n      <option label="3.7R" value="IRX_3.7R">\r\n        IRX with ComOS 3.7R\r\n      </option>\r\n      <option label="3.5R" value="IRX_3.5R">\r\n        IRX with ComOS 3.5R\r\n      </option>\r\n    </optgroup>\r\n  </select>\r\n</form>\r\n\r\n</body>\r\n</html>', NULL, NULL),
(1042, 169, '0', '<code>option</code>s without <code>optgroup</code>.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #169 - Positive</title>\r\n</head>\r\n<body>\r\n\r\n<form action="http://example.com/prog/someprog" method="post">\r\n	<label for="select1">master</label>\r\n  <select name="ComOS" id="select1">\r\n      <option label="3.7.1" value="pm3_3.7.1">\r\n        PortMaster 3 with ComOS 3.7.1\r\n      </option>\r\n      <option label="3.7" value="pm3_3.7">\r\n        PortMaster 3 with ComOS 3.7\r\n      </option>\r\n      <option label="3.5" value="pm3_3.5">\r\n        PortMaster 3 with ComOS 3.5\r\n      </option>\r\n      <option label="3.7" value="pm2_3.7">\r\n        PortMaster 2 with ComOS 3.7\r\n      </option>\r\n  </select>\r\n</form>\r\n\r\n</body>\r\n</html>', NULL, NULL),
(302, 173, '1', 'Anchor with non placeholder text.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #173 - Negative</title>\r</head>\r<body>\r\r<p>Select link for more <a href="dogs.html">information about dogs</a>.</p>\r\r</body>\r</html>', NULL, NULL),
(303, 173, '0', 'Anchor with "click here" text.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #173 - Positive</title>\r</head>\r<body>\r\r<p>For more information <a href="dogs.html">click here</a>.</p>\r\r</body>\r</html>', NULL, NULL),
(304, 174, '1', 'Anchor with text.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #174 - Negative</title>\r</head>\r<body>\r\r<p>Select link for more <a href="dogs.html">information about dogs</a>.</p>\r\r</body>\r</html>', NULL, NULL),
(305, 174, '0', 'Anchor has no text.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>OAC Testfile - Check #174 - Positive</title>\r</head>\r<body>\r\r<p>For more information <a href="dogs.html"></a>.</p>\r\r</body>\r</html>', NULL, NULL),
(306, 175, '1', 'Anchor contains image with Alt text different from link text.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #175 - Negative</title>\r</head>\r<body>\r\r<p>\r<a href="page1.html"><img src="star.jpg" alt=""/>page1</a>\r</p>\r\r</body>\r</html>', NULL, NULL),
(307, 175, '0', 'Anchor contains image with Alt text same as link text.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #175 - Positive</title>\r</head>\r<body>\r\r<p>\r<a href="page1.html"><img src="star.jpg" alt="page1"/>page1</a>\r</p>\r\r</body>\r</html>', NULL, NULL),
(308, 176, '1', 'Does not contain a <code>basefont</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #176 - Negative</title>\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(309, 176, '0', 'Contains a <code>basefont</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #176 - Positive</title>\r</head>\r<body>\r<basefont face="Arial" size="4"/>\r</body>\r</html>', NULL, NULL),
(310, 177, '1', 'Does not contain a <code>font</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #177 - Negative</title>\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(311, 177, '0', 'Contains a <code>font</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r<html lang="en">\r<head>\r<title>OAC Testfile - Check #177 - Positive</title>\r</head>\r<body>\r<font size="4"/>\r</body>\r</html>', NULL, NULL),
(312, 178, '1', 'Alt text conveys same information as image.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #178 - Negative</title>\r</head>\r<body>\r<p><img src="rex.jpg" alt="a black and brown cat named Rex"/></p>\r</body>\r</html>', 'html_code', '<img src="rex.jpg" alt="a black and brown cat named Rex"/>'),
(313, 178, '0', 'Alt text does not convey same information as image.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<title>OAC Testfile - Check #178 - Positive</title>\r</head>\r<body>\r<p><img src="rex.jpg" alt="shoes and suits and clothing and ties"/></p>\r</body>\r</html>', NULL, NULL),
(314, 180, '1', 'Two sequential Anchor elements that have different targets.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #180 - Negative</title>\r</head>\r<body>\r<a href="dogs.html"><img src="icon.gif" alt="Products for dogs" /></a>\r<a href="cats.html">Products For Cats</a>\r</body>\r</html>', NULL, NULL),
(315, 180, '0', 'Two sequential Anchor elements that have the same target.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #180 - Positive</title>\r</head>\r<body>\r<a href="dogs.html"><img src="icon.gif" alt="Products for dogs" /></a>\r<a href="dogs.html">Products For Dogs</a>\r</body>\r</html>', NULL, NULL),
(316, 181, '1', 'Anchor does not use the Javascript URL protocol.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #181 - Negative</title>\r</head>\r<body>\r<a href="fallback.html" onclick="dosomething(); return false;">Scripted link with fallback</a>\r</body>\r</html>', NULL, NULL),
(317, 181, '0', 'Anchor uses the Javascript URL protocol.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #181 - Positive</title>\r</head>\r<body>\r<a href="javascript:dosomething()">Scripted link</a>\r</body>\r</html>', NULL, NULL),
(318, 182, '1', '<code>body</code> does not contain a <code>background</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #182 - Negative</title>\r</head>\r<body>\r</body>\r</html>', NULL, NULL),
(319, 182, '0', '<code>body</code> contains a <code>background</code> attribute.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #182 - Positive</title>\r</head>\r<body background="background.jpg">\r</body>\r</html>', NULL, NULL),
(320, 183, '1', '<code>object</code> contains an <code>embed</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #183 - Negative</title>\r</head>\r<body>\r\r<object classid="clsid:A12BCD3F-GH4I-56JK-xyz"\r    codebase="http://example.com/content.cab" \r    width="100" height="80">\r  <param name="Movie" value="moviename.swf" />\r  <embed src="moviename.swf" width="100" height="80"\r      pluginspage="http://example.com/shockwave/download/">\r  <noembed>\r    <img alt="Still from Movie" src="moviename.gif" \r    width="100" height="80" />\r  </noembed>\r  </embed>\r</object>\r\r</body>\r</html>', NULL, NULL),
(321, 183, '0', '<code>object</code> does not contain an <code>embed</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #183 - Positive</title>\r</head>\r<body>\r\r<object classid="clsid:A12BCD3F-GH4I-56JK-xyz"\r    codebase="http://example.com/content.cab" \r    width="100" height="80">\r  <param name="Movie" value="moviename.swf" />\r</object>\r\r</body>\r</html>', NULL, NULL),
(322, 184, '1', 'Document is part of a collection that has a site map.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #184 - Negative</title>\r</head>\r<body>\r\r<a href="sitemap.html">Site Map</a>\r\r<p>This document is part of a large collection of related documents.</p>\r\r</body>\r</html>', 'result', 'fail'),
(323, 184, '0', 'Document is part of a collection but there is not site map.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #184 - Positive</title>\r</head>\r<body>\r\r<p>This document is part of a large collection of related documents.</p>\r\r</body>\r</html>', NULL, NULL),
(1008, 185, '1', '<code>id</code> attribute values are unique.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html xml:lang="en-US" lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #1 - Negative</title>\r\n</head>\r\n<body>\r\n<table border=1 summary="table #1 with IDs and HEADERS">\r\n<tr>\r\n <th id="city">City</th>\r\n <th id="state">State</th>\r\n</tr>\r\n<tr>\r\n <td headers="city">Phoenix</td>\r\n <td headers="state">Arizona</td>\r\n</tr>\r\n<tr>\r\n <td headers="city">Seattle</td>\r\n <td headers="state">Washington</td>\r\n</tr>\r\n</table>\r\n\r\n\r\n<table border=1 summary="table #2 with IDs and HEADERS">\r\n<tr>\r\n <th id="bigcity">City</th>\r\n <th id="bigstate">State</th>\r\n</tr>\r\n<tr>\r\n <td headers="city">Phoenix</td>\r\n <td headers="state">Arizona</td>\r\n</tr>\r\n<tr>\r\n <td headers="city">Seattle</td>\r\n <td headers="state">Washington</td>\r\n</tr>\r\n</table>\r\n</body>\r\n</html>', NULL, NULL),
(1009, 185, '0', '<code>id</code> attribute values are not unique.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html xml:lang="en-US" lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #185 - Positive</title>\r\n</head>\r\n<body>\r\n<table border=1 summary="table #1 with IDs and HEADERS">\r\n<tr>\r\n <th id="city">City</th>\r\n <th id="state">State</th>\r\n</tr>\r\n<tr>\r\n <td headers="city">Phoenix</td>\r\n <td headers="state">Arizona</td>\r\n</tr>\r\n<tr>\r\n <td headers="city">Seattle</td>\r\n <td headers="state">Washington</td>\r\n</tr>\r\n</table>\r\n\r\n\r\n<table border=1 summary="table #2 with IDs and HEADERS">\r\n<tr>\r\n <th id="city">City</th>\r\n <th id="state">State</th>\r\n</tr>\r\n<tr>\r\n <td headers="city">Phoenix</td>\r\n <td headers="state">Arizona</td>\r\n</tr>\r\n<tr>\r\n <td headers="city">Seattle</td>\r\n <td headers="state">Washington</td>\r\n</tr>\r\n</table>\r\n</body>\r\n</html>', NULL, NULL),
(326, 186, '1', '<code>label</code> does not contain an <code>input</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #186 - Negative</title>\r</head>\r<body>\r\r<form>\r<label for="name">First name: </label> <input type="text" name="firstname" id="name"/>\r</form>\r\r</body>\r</html>', NULL, NULL),
(327, 186, '0', '<code>label</code> contains an <code>input</code> element.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #186 - Positive</title>\r</head>\r<body>\r\r<form>\r<label for="name">First name: <input type="text" name="firstname" id="name"/></label>\r</form>\r\r</body>\r</html>', NULL, NULL),
(328, 187, '1', '<code>input</code> has only 1 associated label.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #187 - Negative</title>\r</head>\r<body>\r\r<form>\r<label for="name">First name: </label>\r<input type="text" name="firstname" id="name"/>\r</form>\r\r\r</body>\r</html>', NULL, NULL),
(329, 187, '0', '<code>input</code> has 2 associated <code>labels</code>.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">\r<html xml:lang="en-US" lang="en">\r<head>\r<title>OAC Testfile - Check #187 - Positive</title>\r</head>\r<body>\r\r<form>\r<label for="name">First name: </label>\r<input type="text" name="firstname" id="name"/>\r<label for="name">Enter your first name: </label>\r</form>\r\r</body>\r</html>', NULL, NULL),
(330, 188, '1', '<code>label</code> contains one printable character.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #188 - Negative</title>\r</head>\r<body>\r\r<form action="http://www.test.com" method="post">\r<p>\r<label for="name">First name: </label>\r<input type="text" name="firstname" id="name"/>\r</p>\r</form>\r\r</body>\r</html>', NULL, NULL),
