(430, 240, '1', 'Text alternative file tells the same story and presents the same information as the multimedia file.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #240.2 - Negative</title>\r</head>\r<body>\r<p>View <a href="movie.wav">the movie</a> <a href="alternative2.html">(text alternative)</a>.</p>\r\r<p>Shown below is the content of the text alternative file.</p>\r\r<p>Harmonica sounds play softly in the background. The setting is a small dusty town in the wild\rwest days. The opening shot is the main street of the town under the bright noon sun. The harmonica sounds stop and the sounds of the wind can be heard softly. A tall man dressed all in black wearing\ra black hat stands at the far end of the street. The shot changes to a closeup of the man''s emotionless face. He spits tobacco juice on the ground but leaves some brown liquid dripping down his chin. He slowly speaks the words "It''s about time now sherrif".</p>\r\r</body>\r</html>', NULL, NULL),
(431, 240, '0', 'Text alternative file does not tell the same story and present the same information as the multimedia file.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #240.1 - Negative</title>\r</head>\r<body>\r<p>View <a href="movie.wmv">the movie</a> <a href="alternative1.html">(text alternative)</a>.</p>\r\r<p>Shown below is the content of the text alternative file.</p>\r\r<p>This movie shows a gunfight.</p>\r\r</body>\r</html>', NULL, NULL),
(1013, 241, '0', 'Table markup is not used for tabular information.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>ATRC Testfile - Check #241.1 - Positive</title>\r\n</head>\r\n<body>\r\n\r\n<p>\r\n<pre>\r\nname		number of cups		  type	      with sugar\r\nAdams, Willie		2		regular		sugar\r\nBacon, Lise		4		regular		no sugar\r\nChaput, Maria		1		decaf		sugar\r\nDi Nino, Consiglio	0		n/a		n/a\r\nEggleton, Art		6		regular		no sugar</pre>\r\n</p>\r\n\r\n</body>\r\n</html>', NULL, NULL),
