(445, 247, '0', 'Checkbox group contains no <code>fieldset</code> or <code>legend</code> elements.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r<head>\r<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r<title>ATRC Testfile - Check #247.1 - Positive</title>\r</head>\r<body>\r\r<form action="http://example.com/donut" method="post">\r<p>\r<input type="checkbox" name="flavour" id="choc" value="chocolate" />\r<label for="choc">Chocolate</label><br/>\r<input type="checkbox" name="flavour" id="cream" value="cream"/>\r<label for="cream">Cream Filled</label><br/>\r<input type="checkbox" name="flavour" id="honey" value="honey"/>\r<label for="honey">Honey Glazed</label>\r<br/><input type="submit" value="Purchase Donuts"/>\r</p>\r</form>\r\r</body>\r</html>', NULL, NULL),
