(466, 258, '1', '<code>applet</code> has a keyboard mechanism that returns focus to the parent window.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN"\r"http://www.w3.org/TR/html4/loose.dtd">\r<html lang="en">\r<head>\r<title>ATRC Testfile - Check #258.2 - Positive</title>\r</head>\r<body>\r<p>The following applet is not working. This is just an example.</p>\r\r<applet code="Press2.class" width="500" height="500"></applet> \r</body>\r</html>', 'result', 'fail'),
(467, 258, '0', '<code>applet</code> does not have a keyboard mechanism that returns focus to the parent window.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN"\r"http://www.w3.org/TR/html4/loose.dtd">\r<html lang="en">\r<head>\r<title>ATRC Testfile - Check #258.1 - Positive</title>\r</head>\r<body>\r<p>The following applet is not working. This is just an example.</p>\r\r<applet code="Press1.class" width="500" height="500"> </applet> \r</body>\r</html>', NULL, NULL),
(468, 259, '1', '<code>object</code> has a keyboard mechanism that returns focus to the parent window.', '<?xml version="1.0" encoding="UTF-8"?>\r<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN"\r"http://www.w3.org/TR/html4/loose.dtd">\r<html lang="en">\r<head>\r<title>ATRC Testfile - Check #259.2 - Positive</title>\r</head>\r<body>\r<p>The following object is not working. This is just an example.</p>\r\r<object classid="http://www.test2.com" title="a simple object" />\r\r</body>\r</html>', 'result', 'fail'),
