(954, 37, '1', '<code>h2</code> follows an <code>h1</code>', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #37 - Negative</title>\r\n</head>\r\n<body>\r\n\r\n<h1>The First Heading</h1>\r\n<p>Here is some demo text.</p>\r\n<h2>The Second Heading</h2>\r\n<p>Here is some more demo text.</p>\r\n\r\n</body>\r\n</html>', NULL, NULL),
(952, 38, '1', '<code>h3</code> follows an <code>h2</code>', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #38 - Negative</title>\r\n</head>\r\n<body>\r\n\r\n<h2>The First Heading</h2>\r\n<p>Here is some demo text.</p>\r\n<h3>This Heading Is OK</h3>\r\n<p>Here is some more demo text.</p>\r\n\r\n</body>\r\n</html>', NULL, NULL),
