(947, 40, '0', '<code>h6</code> follows an <code>h4</code>', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #40 - Positive</title>\r\n</head>\r\n<body>\r\n\r\n<h4>The First Heading</h4>\r\n<p>Here is some demo text.</p>\r\n<h6>The bad Heading</h6>\r\n<p>Here is some more demo text.</p>\r\n\r\n</body>\r\n</html>', NULL, NULL),
(994, 142, '1', 'File <code>input</code> element has valid <code>tabindex</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>ATRC Testfile - Check #142.2 - Positive</title>\r\n</head>\r\n<body>\r\n<form action="http://www.example.com" method="post">\r\n<p>\r\n<label for="name">Name</label>: <input type="file" name="name" id="name" tabindex="1" />\r\n</p>\r\n</form>\r\n</body>\r\n</html>', NULL, NULL),
(995, 142, '0', 'File <code>input</code> element does not have <code>tabindex</code> attribute.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>ATRC Testfile - Check #142.1 - Positive</title>\r\n</head>\r\n<body>\r\n<form action="http://www.example.com" method="post">\r\n<p>\r\n<label for="name">Name</label>: <input type="file" name="name" id="name"  />\r\n</p>\r\n</form>\r\n</body>\r\n</html>', NULL, NULL),
(1004, 143, '1', 'Valid <code>address</code> content.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #143 - Negative</title>\r\n</head>\r\n<body>\r\n<address><a href="mailto:name@company.com">joe smith</a></address>\r\n</body>\r\n</html>', 'html_code', '<address><a href="mailto:name@company.com">joe smith</a></address>'),
(1005, 143, '0', 'Does not have a valid <code>address</code> content.', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #143 - Positive</title>\r\n</head>\r\n<body>\r\n<address>Portugal</address>\r\n</body>\r\n</html>', NULL, NULL),
(1024, 83, '1', 'No ASCII art used with <code>pre</code> element', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #82 - Negative</title>\r\n</head>\r\n<body>\r\n\r\n<img src="myart.jpg"></img>\r\n\r\n</body>\r\n</html>', NULL, NULL),
(1025, 83, '0', 'ASCII art in <code>pre</code> element', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>OAC Testfile - Check #82 - Negative</title>\r\n</head>\r\n<body>\r\n\r\n\r\n<PRE>\r\n          MMMMMMMM\r\n      WWWWW      WWWWW\r\n     ******************\r\n        | \\O/ \\O/ |\r\n        |    |    |\r\n        \\         /\r\n         \\  ---  /\r\n           VVVVV\r\n            VVV\r\n\r\n</PRE>\r\n\r\n</body>\r\n</html>', NULL, NULL),
(1027, 101, '0', 'There is a <code>iframe</code> element', '<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head><title>A simple frameset document</title></head>\r\n<body>\r\n\r\n<iframe>\r\n<a href="lib.html" title="Library link">Select to go to the electronic library</a>\r\n</iframe>\r\n\r\n</body>\r\n</html>', NULL, NULL),
(1035, 179, '1', 'There is a Glossary called Key Terms in the end of the page', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #179 - Negative</title>\r\n</head>\r\n<body>\r\n\r\n<h1>Example 1</h1>\r\n<p>\r\nUsers of on line chat forums have created several acronyms and abbreviations to speed up typing conversations on the computer. For example, LOL refers to "laughing out loud" and FWIW abbreviates "for what it''s worth". The site provides a glossary page that lists the expansions for the commonly used acronyms and abbreviations.\r\n</p>\r\n<h1>Example 2</h1>\r\n<p>\r\nA Web page discussing mathematical theory includes a glossary of commonly used mathematical terms, abbreviations and acronyms.\r\n</p>\r\n<h1>Example 3</h1>\r\n<p>\r\nA textbook contains a glossary of new vocabulary words introduced in each chapter.\r\n</p>\r\n<h1>Example 4</h1>\r\n<p>\r\nDutch text uses the phrase '' Hij ging met de kippen op stok '' (He went to roost with the chickens). The glossary explains that this phrase means '' Hij ging vroeg naar bed '' (He went to bed early).\r\n</p>\r\n<h1>Example 5: A glossary of idiomatic expressions</h1>\r\n<p>\r\nThe American novel "The Adventures of Huckleberry Finn" includes many idiomatic expressions that were used in the southwestern United States in the 1840s. In an online edition designed for students, each idiomatic expression is linked to an item in the glossary.\r\n</p>\r\n\r\n<h2>Key Terms</h2> \r\n<h3>Web page</h3> <p>A non-embedded resource obtained from a single URI using HTTP plus any other resources that are used in the rendering or intended to be rendered together with it by a user agent.</p>\r\n<h3>process</h3> <p>Series of user actions where each action is required in order to complete an activity.</p>\r\n<h3>set of Web pages</h3> <p>Collection of Web pages that share a common purpose and that are created by the same author, group or organization.</p>\r\n</body>\r\n</html>', 'result', 'fail'),
(1036, 179, '0', 'There is no Glossary', '<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN""http://www.w3.org/TR/REC-html40/loose.dtd">\r\n<html lang="en">\r\n<head>\r\n<title>OAC Testfile - Check #179 - Positive</title>\r\n</head>\r\n<body>\r\n<h1>No Glossary</h1>\r\n<p>The glossary is included at the end of the Web page or the glossary is located via one of the mechanisms for locating content within a set of Web pages. (See Understanding Success Criterion 2.4.5.)</p>\r\n</body>\r\n</html>', NULL, NULL),
(1037, 210, '1', '<code>select</code> element has an associated and well defined label using <code>label</code> element.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>ATRC Testfile 91.2 - Negative</title>\r\n</head>\r\n<body>\r\n<form method="post" action="http://www.test.com">\r\n<p>\r\n<label for="animal">Animal:</label>\r\n<select name="abcselect" id="animal">\r\n<option value="1">dog</option>\r\n<option value="2">cat</option>\r\n<option value="3">bird</option>\r\n</select>\r\n</p>\r\n</form>\r\n</body>\r\n</html>', 'result', 'fail'),
(1038, 210, '0', '<code>select</code> element does not have a meaningful <code>label</code>.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>ATRC Testfile 91.1 - Positive</title>\r\n</head>\r\n<body>\r\n<form method="post" action="http://www.test.com">\r\n<p>\r\n<label>Person</label>\r\n<select name="abcselect" id="animal">\r\n<option value="1">dog</option>\r\n<option value="2">cat</option>\r\n<option value="3">bird</option>\r\n</select>\r\n</p>\r\n</form>\r\n</body>\r\n</html>', NULL, NULL),
(1044, 211, '0', 'Labels are positioned far from controls.', '<?xml version="1.0" encoding="UTF-8"?>\r\n<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/xhtml; charset=UTF-8" />\r\n<title>Testfile - Check #211.1 - Positive</title>\r\n</head>\r\n<body>\r\n<form action="http://www.example.com" method="post">\r\n<table width="100%">\r\n<tr><td>first name:</td><td align="right"><input type="text" /></td></tr>\r\n<tr><td>last name:</td><td align="right"><input type="text" /></td></tr>\r\n<tr><td>favorite color:</td><td align="right"><input type="text" /></td></tr>\r\n<tr><td colspan="2"><input type="submit" value="submit" /></td></tr>\r\n</table>\r\n</form>\r\n\r\n</body>\r\n</html>', NULL, NULL);
